import React from 'react';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, CardHeader, CardFooter
} from 'reactstrap';
import 'typeface-rubik'



const CardService = (props) => {
   
  return (

    <div>

<div className="p-3 my-2 rounded">
        <Toast>
          <ToastHeader>
            Reactstrap
          </ToastHeader>
          <ToastBody>
            This is a toast on a white background â€” check it out!
          </ToastBody>
        </Toast>
      </div>

      
<Card body inverse style={{ backgroundColor: '#ffffff', borderColor: '#E6EAF6' }}>
        <CardHeader className="headerCard">{props.details.categoria}</CardHeader>
        <CardBody>
          <CardTitle className="titleCard">{props.details.nomedavaga}</CardTitle>
          <CardText className="subtitleCard">{props.details.empresa}</CardText>
          <CardText className="textCard">{props.details.horas}</CardText>
          <button className={"font","buttonCard"}>Participar</button> 
        </CardBody>
        <CardFooter className="footerCard">{props.details.cidade}</CardFooter>
      </Card>

      
    </div>

  );
};

export default CardService;
